import{_ as a,c as e,a2 as d,o as r}from"./chunks/framework.3VuPyQdv.js";const x=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"doc-text/wx/wx12.md","filePath":"doc-text/wx/wx12.md","lastUpdated":1742700738000}'),o={name:"doc-text/wx/wx12.md"};function n(h,t,i,l,s,c){return r(),e("div",null,t[0]||(t[0]=[d('<h2 id="_11-协同工作和发布-小程序的版本" tabindex="-1">11. 协同工作和发布 - 小程序的版本 <a class="header-anchor" href="#_11-协同工作和发布-小程序的版本" aria-label="Permalink to &quot;11. 协同工作和发布 - 小程序的版本&quot;">​</a></h2><h4 id="_11-1-软件开发过程中的不同版本" tabindex="-1">11.1 软件开发过程中的不同版本 <a class="header-anchor" href="#_11-1-软件开发过程中的不同版本" aria-label="Permalink to &quot;11.1 软件开发过程中的不同版本&quot;">​</a></h4><p>​ 在软件开发过程中，根据时间节点的不同，会产出不同的软件版本，例如：</p><p>​ ①开发者编写代码的同时，对项目代码进行自测（开发版本）</p><p>​ ②直到程序达到一个稳定可体验的状态时，开发者把体验版本给到产品经理和测试人员进行体验测试</p><p>​ ③最后修复完程序的 Bug 后，发布正式版供外部用户使用</p><hr><h4 id="_11-2-小程序的版本" tabindex="-1">11.2 小程序的版本 <a class="header-anchor" href="#_11-2-小程序的版本" aria-label="Permalink to &quot;11.2 小程序的版本&quot;">​</a></h4><p>​</p><table tabindex="0"><thead><tr><th>版本阶段</th><th>说明</th></tr></thead><tbody><tr><td>开发版本</td><td>使用开发者工具，可将代码上传到开发版本中。 开发版本只保留每人最新的一份上传的代码。 点击提交审核，可将代码提交审核。开发版本可删除，不影响线上版本和审核中版本的代码。</td></tr><tr><td>体验版本</td><td>可以选择某个开发版本作为体验版，并且选取一份体验版。</td></tr><tr><td>审核中的版本</td><td>只能有一份代码处于审核中。有审核结果后可以发布到线上，也可直接重新提交审核，覆盖原审核版本。</td></tr><tr><td>线上版本</td><td>线上所有用户使用的代码版本，该版本代码在新版本代码发布后被覆盖更新。</td></tr></tbody></table>',10)]))}const _=a(o,[["render",n]]);export{x as __pageData,_ as default};
